import React, { useEffect, useState } from "react";
import "./Navbar.scss";
import {Link, useLocation} from 'react-router-dom'

const Navbar = () => {
  const [active, setActive] = useState(false);
  const [open, setOpen] = useState(false);

  const {pathname} =useLocation()

  const isActive = () => {
    window.scrollY > 0 ? setActive(true) : setActive(false);
  };

  useEffect(() => {
    window.addEventListener("scroll", isActive);
    return () => {
      window.removeEventListener("scroll", isActive);
    };
  }, []);

  const currentUser = {
    id: 1,
    username: "Febin",
    isSeller: true,
  };

  return (
    <div className={active ||pathname !== '/' ? "navbar active" : "navbar"}>
      <div className="container">
        <div className="logo">
          <Link to="/" className="link">
          <span className="text">fiverr</span>
          </Link>
          <span className="dot">.</span>
        </div>
        <div className="links">
          <span>Fiverr Buisness</span>
          <span>Explore</span>
          <span>English</span>
          <span>Sign in</span>
          {!currentUser?.isSeller && <span>Become a seller</span>}
          {!currentUser && <button>Join</button>}
          {currentUser && (
            <div className="user" onClick={() => setOpen(!open)}>
              <img
                src="https://images.pexels.com/photos/1115697/pexels-photo-1115697.jpeg?auto=compress&cs=tinysrgb&w=1600"
                alt="profile"
              />
              <span>{currentUser?.username}</span>
              {open &&  <div className="options">
                {currentUser?.isSeller && (
                  <>
                    <Link className='link' to='/mygigs'>Gigs</Link>
                    <Link className='link' to='/add'>Add New Gig</Link>
                  </>
                )}
                <Link className='link' to='/orders'>Orders</Link>
                <Link className='link' to='/messages'>messages</Link>
                <Link className='link'> Logout</Link>
              </div>}
            </div>
          )}
        </div>
      </div>
      {(active ||pathname !=='/') && (
        <>
          <hr />
          <div className="menu">
           <Link className="link menuLink" to='/'>Graphics & Design</Link>
           <Link className="link" to='/'>Vedio & Animation</Link>
           <Link className="link" to='/'>Writing & Translation</Link>
           <Link className="link" to='/'>AI Services</Link>
           <Link className="link" to='/'>Digital Marketing</Link>
           <Link className="link" to='/'>Music & Audio</Link>
           <Link className="link" to='/'>Programming & Tech</Link>
           <Link className="link" to='/'>Buisness</Link>  
           <Link className="link" to='/'>Lifestyle</Link>
          </div>
        </>
      )}
    </div>
  );
};

export default Navbar;
